    <title>EMBED</title>

  <style>
    * {
      box-sizing: border-box;
    }

    html, body {
      margin: 0;
      padding: 0;
      width: 100%;
      height: 100%;
      background-color: #1a202c;
      transition: background-color 2s ease;
      overflow-x: hidden;
    }

    body.bg-black {
      background-color: #000;
    }

    .wrapper {
      min-height: 100vh;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: flex-start;
      padding: 20px 5vw 40px;
      color: #eee;
    }

    .card-container {
      background-color: #000;
      border-radius: 1rem;
      box-shadow: 0 20px 40px rgba(0, 0, 0, 0.3);
      overflow: hidden;
      width: 90vw;
      max-width: 800px;
      aspect-ratio: 16 / 9;
      opacity: 0;
      transform: scale(0.5);
      transform-origin: center;
      transition: box-shadow 1.5s ease;
      margin: 0 auto;
    }

    .card-container iframe {
      background-color: #000;
      border-radius: 1rem;
    }

    .card-container.active {
      animation: openCard 1.5s ease-out forwards;
    }

    .card-container.white-shadow {
      box-shadow: 0 0 40px 5px rgba(255, 255, 255, 0.7);
    }

    @keyframes openCard {
      0% {
        opacity: 0;
        transform: scale(0.5);
        width: 0;
      }
      50% {
        opacity: 1;
        transform: scale(0.75);
        width: 45vw;
      }
      100% {
        opacity: 1;
        transform: scale(1);
        width: 90vw;
        max-width: 800px;
      }
    }

    iframe {
      width: 100%;
      height: 100%;
      border: none;
    }

    .code-container {
      display: flex;
      flex-direction: column;
      align-items: center;
      width: 90vw;
      max-width: 800px;
      gap: 8px;
      margin-top: 20px;
    }

    .code-box {
      background-color: #333;
      border-radius: 0.5rem;
      padding: 12px 20px;
      width: 100%;
      font-size: 14px;
      font-family: monospace;
      color: #eee;
      user-select: text;
      white-space: pre-wrap;
      word-break: break-word;
      position: relative;
      box-shadow: 0 8px 16px rgba(0, 0, 0, 0.5);
    }

    #copy-btn {
      font-size: 1.25rem;
      padding: 0.5rem 1.5rem;
    }

    .copy-msg {
      position: absolute;
      top: -28px;
      right: 20px;
      background: #222;
      color: #0f0;
      font-size: 12px;
      padding: 4px 8px;
      border-radius: 4px;
      opacity: 0;
      pointer-events: none;
      transition: opacity 0.3s ease;
    }

    .copy-msg.show {
      opacity: 1;
    }

    @media (max-width: 400px) {
      .code-box {
        font-size: 12px;
      }

      #copy-btn {
        font-size: 1.1rem;
        padding: 0.4rem 1.2rem;
      }

      .wrapper {
        padding: 15px 3vw 40px;
      }
    }
  </style>
</head>
<body>
  <div class="wrapper">
    <div id="card" class="card-container"></div>

    <div class="code-container mt-3">
      <div id="code-box" class="code-box" tabindex="0" role="textbox" aria-label="Código do iframe">
        <span class="copy-msg" id="copy-msg">Copiado!</span>
      </div>
      <button id="copy-btn" class="btn btn-primary mt-2" aria-label="Copiar código do iframe">Copiar Iframe</button>
    </div>
  </div>
